INSERT INTO `web_about` (`id`, `content`) VALUES
(3, '<h3><strong>ABOUT JYBCE</strong></h3>\r\n\r\n<p><strong>WELCOME TO</strong><br />\r\n<strong><span dir=\"ltr\">JATIYA YUVA BOARD OF COMPUTER EDUCATION</span></strong></p>\r\n\r\n<p><strong><span dir=\"ltr\">(A Unit of JYBCE FOUNDATION)</span></strong></p>\r\n\r\n<p>&nbsp;has been registered under the Trust Act. Government of West Bengal,(&nbsp;Regn No WB&nbsp;<strong>NO: IV-</strong>190300123/2018<strong>)&nbsp;</strong>working in different fields of Programme &amp; Commercial Training sponsored by the Central Government by taking a vow to approach every class of Youth in the society. The Organization is also certified by ISO 9001: 2015. The Institute &amp; the Organization is also Registered under the Ministry of CR Act 1957, MHRD, Govt. of India and is accredited to conduct the various fields of technical programs sponsored by both the Govt.</p>\r\n\r\n<p>JATIYA YUVA BOARD OF COMPUTER EDUCATION The main function of the Trust is to provide higher technical education in nominal charges for every group of society of Urban &amp; Rural areas all over India and get success in computer revolution which is the main dream of Indian Govt. targets to provide basis information about necessity of computer literacy in various fields, with enough quality knowledge. We arrange special Guide in our study centre&rsquo;s for the help of students so that they can easily continue with their courses happily.</p>\r\n');
